//2021/07/12 10:38:15 Alloc:268648(bytes) Sys:74531848(bytes) HeapObjects:3499(bytes) HeapInuse:704512(bytes)

func TestCache_StoreOrUpdate(t *testing.T) {
	cache := NewCache(10)
	cache.memyinfo()

	for i := 1; i <= 100000; i++ {
		cache.StoreOrUpdate("qmjz", int64(i), "zcjb", []byte(""))
	}

	time.Sleep(30 * time.Second)

	fmt.Println(cache.Get("qmjz", 100000-2, "zcjb"))

	cache.dump()

	fmt.Println(cache.AllKeys())

	for range time.Tick(10 * time.Second) {
		fmt.Println("观察内存是否下降...")
	}
}
